import React from "react";
import "./home.css";

const pallete = ["red", "orange", "black", "purple"];

const Home = () => {
    return (<>
        <section className="Home">
            <h1>Home Page!</h1>
            {
                pallete.forEach(element => {
                    return (
                        <>
                            <div className="colour-pallete">
                                <div className="colour-stile"></div>
                                <div className="colour-name">Black</div>
                            </div>
                        </>
                    )
                })
            }
        </section>
    </>)
}

export {Home}
